        "id": "9df15973-5421-47d1-8118-3b1edbfb6382",
        "description": "This service provides Scania assistance information \nFor a Scania Assistance unit the following criterion has to be fulfilled:\n\n•\tThere is an international phone number available 24 hours a day, 365 days a year answered by trained service coordinators. The phone number is dedicated to this purpose and the service coordinators always use the phrase “Scania Assistance” when answering the phone.\n•\tThe service coordinators can easily communicate with national customers and workshop personnel. If the center handles international traffic the service coordinators have to be able to communicate with other centers in  English.\n•\tThe service coordinators have online access to the spare part availability of the dealers/workshops.                             \n•\tThe service coordinators have access to contact information for available mechanics 24 hours a day, 365 days a year.\n•\tThe service coordinators have access to information regarding the credit dignity/value of the most important national customers. The service coordinators have access to the contact information of dealer personnel authorized to provide a guarantee of payment 24 hours a day, 365 days a year.\n•\tThe service coordinators can mediate and arrange a guarantee of payment from the customers’ home dealer to the repairing workshop.\n•\tThe mechanics on call are equipped with mobile phones and have access to service vans, tools, and spare parts 24 hours a day, 365 days a year.\n•\tA log is kept of all taken actions in a case handling system. The data from the log is also used to keep statistics and to follow up on the business with the help of Key Performance Indicators as defined by Scania Assistance.",
